import { motion } from "framer-motion"

function WrapFondu (props) {
    return (
        <motion.div
        exit={{opacity: 0}}
        animate={{opacity: 1}}
        initial={{opacity: 0}}
        transition={{duration: 0.8}}
        >
            {props.app}
        </motion.div>
    )
}

export {
    WrapFondu
}
